contracts/ContestD.sol.content:
pragma solidity ^0.8.8;

contract ContestD {
    
    struct Contest{
        string startTime;
        uint256 endTime;
        string name;
        address creator;
    }

    struct ContestDonation{
        address payable user;
        uint256 amount;
        string playbackId;
    }

    mapping(string => string[]) contestVideos;

    Contest[] allContests;
    mapping(string => ContestDonation[]) allContestsDonations;
    
    //temporary
    mapping(string => ContestDonation[]) contestEndMap;

    function createContest(string calldata startTime, uint duration,string calldata name) public{
        uint256 endTime = block.timestamp + duration*60;
        Contest memory cont = Contest(startTime,endTime,name,msg.sender);
        allContests.push(cont);
    }

    function addVideosInContest(string calldata playbackId,string calldata contestName) public {
        contestVideos[contestName].push(playbackId);
    }

    function getVideosInContest(string calldata contestName) public view returns(string[] memory) {
        return contestVideos[contestName];
    } 
    
    function fetchAllContests() public view returns(Contest[] memory){
        return allContests;
    }

    function stakeInContest(string calldata key,string calldata contestName) payable public {
        ContestDonation memory contD =  ContestDonation(payable(msg.sender),msg.value,key);
        allContestsDonations[contestName].push(contD); 
    }

    function fetchContestDonations(string calldata name) public view returns(ContestDonation[] memory){
        string memory contName;
        for(uint i=0;i<allContests.length;i++){
            if(keccak256(abi.encodePacked(name))==keccak256(abi.encodePacked(allContests[i].name))){
                contName = allContests[i].name;
            }
        }
        ContestDonation[] memory contDonations = allContestsDonations[contName];
        return contDonations;
    }

    function checkWinner(ContestDonation[] memory contestDonations) public returns(string memory){
        string memory winner;
        uint mx = 0;
        for(uint i=0;i<contestDonations.length;i++){
            contestEndMap[contestDonations[i].playbackId].push(contestDonations[i]);
            // if(contestEndMap[contestDonations[i].playbackId].length > mx){
            //     mx = contestEndMap[contestDonations[i].playbackId].length;
            //     winner = contestEndMap[contestDonations[i].playbackId][0].playbackId;
            // }
        }
        for(uint i=0;i<contestDonations.length;i++){
            if(contestEndMap[contestDonations[i].playbackId].length>mx){
                mx = contestEndMap[contestDonations[i].playbackId].length;
                winner = contestEndMap[contestDonations[i].playbackId][0].playbackId;
            }
        }

        return winner;
    }

    function releaseFunds(string calldata contestName) public payable{
        Contest memory cont;
        for(uint i=0;i<allContests.length;i++){
            if(keccak256(abi.encodePacked(contestName))==keccak256(abi.encodePacked(allContests[i].name))){
                cont= allContests[i];
            }
        }
        // require(block.timestamp >= cont.endTime,"Contest is Live");
        ContestDonation[] memory currentContDonation = allContestsDonations[cont.name];
        string memory winner = checkWinner(currentContDonation);
        uint winnersCount=0;
        uint256 totalAmount=0;
        for(uint i=0;i<currentContDonation.length;i++){
            if(keccak256(abi.encodePacked(winner)) == keccak256(abi.encodePacked(currentContDonation[i].playbackId))){
                address payable user  = currentContDonation[i].user;
                uint256 amount = currentContDonation[i].amount;
                user.transfer(amount); 
                winnersCount++;
            }else{
                totalAmount += currentContDonation[i].amount;
            }
        }
        uint256 winnersAmount = totalAmount/winnersCount;
        for(uint i=0;i<currentContDonation.length;i++){
            if(keccak256(abi.encodePacked(winner)) == keccak256(abi.encodePacked(currentContDonation[i].playbackId))){
                address payable user= currentContDonation[i].user;
                user.transfer(winnersAmount);
            }
        }
    }
}

contracts/Stream.sol.content:
pragma solidity ^0.8.8;

contract Stream {
    uint index = 0;

    address public owner;

    struct Video {
        string videoKey;
        string type_;
    }

    struct Donation {
        address payable client;
        uint256 amount;
        string message;
    }

    struct VideoD {
        string key;
        address payable creator;
    }

    VideoD[] public regularVideoD;
    VideoD[] public streamVideoD;
    mapping(address => Video[]) public VMap;
    mapping(string => Donation[]) public VideoDonations;
    string[] public videoKeys;

    constructor() {
        owner = msg.sender;
    }

    function addVideo(string calldata key, string calldata type_) public {
        Video memory vid = Video(key, type_);
        VMap[msg.sender].push(vid);
        videoKeys.push(key);
        VideoD memory vd = VideoD(key, payable(msg.sender));
        if (keccak256(abi.encodePacked(type_)) == keccak256(abi.encodePacked("regular"))) {
            regularVideoD.push(vd);
        } else {
            streamVideoD.push(vd);
        }
    }

    function addDonations(string calldata key,string calldata message) public payable {
        Donation memory d = Donation(payable(msg.sender), msg.value,message);
        VideoDonations[key].push(d);
        address creator = getVideoCreator(key);
        payable(creator).transfer(msg.value);
    }

    function getVideoCreator(
        string calldata key
    ) public view returns (address) {
        for (uint i = 0; i < regularVideoD.length; i++) {
            if (
                keccak256(abi.encodePacked(regularVideoD[i].key)) ==
                keccak256(abi.encodePacked(key))
            ) {
                return regularVideoD[i].creator;
            }
        }

        for (uint i = 0; i < streamVideoD.length; i++) {
            if (
                keccak256(abi.encodePacked(streamVideoD[i].key)) ==
                keccak256(abi.encodePacked(key))
            ) {
                return streamVideoD[i].creator;
            }
        }
    }

    function checkKey(string calldata key) public view returns (bool) {
        for (uint i = 0; i < videoKeys.length; i++) {
            if (
                keccak256(abi.encodePacked(videoKeys[i])) ==
                keccak256(abi.encodePacked(key))
            ) {
                return true;
            }
        }
        return false;
    }

    //Refund Amount
    function releaseFunds(string calldata key) public {
        require(checkKey(key), "This Video is not registerd");
        Donation[] memory donations = VideoDonations[key];
        for (uint i = 0; i < donations.length; i++) {
            address payable a = donations[i].client;
            uint amount = donations[i].amount;
            a.transfer(amount);
        }
        delete VideoDonations[key];
    }

    function getDonations(
        string calldata key
    ) public view returns (Donation[] memory) {
        return VideoDonations[key];
    }

    function getRegularVideos() public view returns (VideoD[] memory) {
        return regularVideoD;
    }

    function getStreamVideos() public view returns (VideoD[] memory) {
        return streamVideoD;
    }

    function getAllVideosOfCreator(
        address userAddress
    ) public view returns (Video[] memory) {
        return VMap[userAddress];
    }
}

